import React from "react";
import "./App.css";
import FlowerNav from "./components/FloverNav";
import FlowerField from "./components/FloverField";
import { FlowerIntro } from "./components/FloverIntro";
import { FlowerChoosingBouquet } from "./components/FloverChoosingBouquet";

const App = () => {
  return (
    <>
      <FlowerNav />
      <FlowerField />
      <FlowerIntro />
      <FlowerChoosingBouquet />
    </>
  );
};

export default App;
